import './App.css';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams
} from "react-router-dom";
import HeadingWithList from './components/HeadingWithList';
const bucketListData = [
  {
    title:"Bucket 1",
    bucketId:"123"
  },
  {
    title:"Bucket 2",
    bucketId:"123"
  },
  {
    title:"Bucket 3",
    bucketId:"123",
  }
]

function App() {
  <Router>
    <Switch>
      <Route path="/" children={<HeadingWithList type="Bucket List"/>} />
      <Route path="/bucket-list/:id" children={<HeadingWithList type="Bucket List"/>} />
    </Switch>
  </Router>
}

export default App;
